package com.xworks.Inheritance.external;

public class Dog {
    public void dog()
    {
        System.out.println("no-args const of dog");
    }

    public void breathing() {
        System.out.println("runner breathing of dog");
    }

    public void eating() {
        System.out.println("runner eating of dog");
    }

    public void sleeping() {
        System.out.println("runner sleeping of dog");
    }

    public void barking() {
        System.out.println("runner barking of dog");
    }

    public void wagging() {
        System.out.println("runner wagging of dog");
    }
}

